fields.info_text:
{"de": "####INFO

Anzahl Zimmer

Die Anzahl Zimmer umfasst alle bewohnbaren Räume der Wohnung wie Wohnzimmer, Schlafzimmer usw. Nicht gezählt werden Küche, Badezimmer, Duschen, Toiletten, Abstellräume, Korridore, halbe Zimmer, Veranden sowie zusätzliche separate Wohnräume ausserhalb der Wohnung.", "fr": null, "it": null}

fields.static_content:
{"de": "---

#### Arbeitsräume (Raumhöhe, Bodenfläche, Fenster)

Die lichte Raumhöhe (cm) und die Bodenfläche (m²) müssen aus den Plänen ersichtlich sein. Bei unterirdischen Arbeitsräumen müssen ausserdem die Höhe von Böschungen, Abgrabungen und Brüstungen in den Plänen ersichtlich sein.", "fr": "", "it": ""}

fields.info_text:
{"de": "#### INFO
Die Auswahl "Art der Arbeiten" nimmt einerseits Bezug auf das gesamte Bauprojekt. Wenn Sie also im Rahmen eines Bauprojekts sowohl Neubauten als auch Umbauten erstellen und wenn allenfalls im gleichen Bauprojekt auch Gebäude abgebrochen werden, können Sie auch mehrere Varianten gleichzeitig auswählen.

Andererseits erscheint die gleiche Abfrage auch unter der Rubrik "Hochbau" in der Tabelle "Gebäude und Anlagen". Dies deshalb, weil je nach Bauprojekt den Gebäuden allenfalls unterschiedliche bauliche Massnahmen zugeordnet werden müssen.", "fr": null, "it": null}

{"de": "#### INFO
Listen Sie bitte die Gefahrenstoffe, welche gesundheitsschädliche, ätzende, brand- oder explosionsgefährliche Eigenschaften aufweisen, im dafür vorgesehenen Feld auf und machen Sie bitte Mengenangaben.

Falls es sich um eine umfangreiche Liste handelt, laden Sie diese bitte bei den Dokumenten hoch und machen Sie im Eingabefeld einen entsprechenden Vermerk (zum Beispiel: siehe beiliegende Gefahrenstoffliste)", "fr": null, "it": null}

fields.static_content:
{"de": "---

#### Ausgänge, Fluchtwege

Die Lage der Treppenhäuser, die zusätzlichen Ausgänge und Fluchtwege, die Laufbreite der Treppen sowie die Art und Drehrichtung der Türen müssen in den Plänen ersichtlich sein.", "fr": "", "it": ""}

