fields.info_text:
{"de": "**Brandschutzrelevante Vorhaben**

Für alle brandschutzrelevanten Vorhaben ist ein Brandschutznachweis einzureichen.  Ein Brandschutznachweis besteht grundsätzlich aus dem Nachweis (Textteil) und den Brandschutzplänen. Eine entsprechende Anleitung ist auf [www.brandschutznachweis.ch]  (https://www.brandschutznachweis.ch/de/vorlagen-arbeitshilfen) zu finden .

Bei Vorhaben wo lediglich Schutzabstände betroffen sind, kann allenfalls ein vereinfachter Brandschutznachweis (vermasster Situationsplan mit Darlegung der Massnahmen gemäss BSR 15-15 Ziffer 2.4) eingereicht werden.", "fr": null, "it": null}

fields.static_content:
{"de": "---

#### Druckbehälter
Die Art der Druckbehälter, deren Lage im Betrieb bzw. auf dem Betriebsareal, sowie Inhalt, Betriebsdruck und Mengenangaben müssen entweder in den Plänen ersichtlich sein oder mittels einer separaten Liste deklariert werden.", "fr": "", "it": ""}

fields.info_text:
{"de": "####INFO

EGID ist die eidgenössische Gebäudeidentifikationsnummer gemäss dem Gebäude- und Wohnungsregister des Bundesamtes für Statistik (BfS)

Diese Nummer wird im Rahmen der Nachführung des GWR automatisch ausgefüllt.", "fr": null, "it": null}

fields.static_content:
{"de": "#### Erdbebensicherheit

Bei Neubauten sind die Bestimmungen der Tragwerksnormen SIA 260 bis SIA 267 einzuhalten.  Die Überprüfung bestehender Gebäude bezüglich Erdbeben erfolgt nach SIA-Norm 269/8.
Bei Umbauten (z.B. Anbau, Aufbau oder Aufstockung, Eingriff in die Tragstruktur) sind ausser bei Bagatellfällen erforderliche Ertüchtigungsmassnahmen gemäss SIA-Norm 269/8 umzusetzen.", "fr": "", "it": ""}

fields.info_text:
{"de": "####INFO

EWID ist die eigenössische Wohnungsidentifikationsnummer im Gebäude - und Wohnungsregister des Bundesamtes für Statistik (AfS).

Diese Nummer wird im Rahmen der Nachführung des GWR automatisch ausgefüllt.", "fr": null, "it": null}

fields.static_content:
{"de": "#### Ex-Zonen
Der Lagerort, die Menge und die Art von ätzenden, brand-oder explosionsgefährlichen Stoffen muss in den Plänen ersichtlich sein. Falls notwendig, erstellen Sie bitte ein entsprechendes Konzept, woraus auch die Belüftung der Lagerräume von Ex-Zonen und deren Überwachung aufgezeigt wird. 

Details zum Thema Ex-Zonen können dem SUVA Merkblatt 2153 „Explosionsschutz. Grundsätze, Mindestvorschriften, Zonen“ entnommen werden.", "fr": "", "it": ""}

{"de": "#### Angaben zur Gebäudehülle
Materialien und Farbgebung der Fassade, der Gebäudeöffnungen (Fenster und Türen) und der Bedachung. Bei umfangreichen Projekten (z.B. Gesamtüberbauungen, grössere Bauten und Anlagen, Bauten in sensiblen Gebieten wie Kern- und/oder Ortsbildschutzzonen) bitten wir Sie, ein Farbkonzept einzureichen.

In diesem Zusammenhang verweisen wir auf das Merkblatt [Farbgebung in Ortsbildern und in der Landschaft](https://www.ur.ch/_docn/187162/Merkblatt_Farbgebung_in_Ortsbildern_und_in_der_Landschaft_Version_2.pdf)", "fr": "", "it": ""}

{"de": "---

#### Förderanlagen
Hinweise zu Förderanlagen sind in den Normen SN EN 619 "Stetigförderer und Systeme - Sicherheits- und EMV-Anforderungen an mechanische Fördereinrichtungen für Stückgut" und SN EN 620 "Stetigförderer und Systeme - Sicherheits- und EMV-Anforderungen für ortsfeste Gutförderer für Schüttgut" sowie in den Suva-Checklisten 67022 und 67024 enthalten.", "fr": "", "it": ""}

{"de": "**Wichtige Hinweise**

- Parkplätze mit mehr als 500 Stellplätzen sind UVP pflichtig.

- Grundsätzlich ist bei allen Parkierungsanlagen zu prüfen, ob und wie viele behindertengerechte Parkplätze erstellt werden müssen.", "fr": "", "it": ""}

{"de": "---

#### Innerbetriebliche Emissionen

**Lärm und Erschütterungen:** Gebäude und Gebäudeteile müssen so gestaltet sein, dass die Sicherheit und die Gesundheit der Arbeitnehmer nicht durch Lärm oder Vibrationen gefährdet werden. Arbeitsmittel müssen so gestaltet sein, dass die Sicherheit und die Gesundheit der Arbeitnehmer nicht durch Lärm oder Vibrationen gefährdet werden. Arbeitsabläufe und Produktionsverfahren müssen so gestaltet und durchgeführt werden, dass die Sicherheit und die Gesundheit der Arbeitnehmer nicht durch Lärm oder Vibrationen gefährdet werden. Zum Schutz der Arbeitnehmer sind insbesondere folgende Vorkehrungen zu treffen: 

- a. bauliche Massnahmen; 
- b. Massnahmen an Betriebseinrichtungen; 
- c. Isolation oder örtliche Abtrennung der Lärmquelle; 
- d. Massnahmen der Arbeitsorganisation.

**Raumakustischer Nachweis:** Für sämtliche Arbeitsräume mit Arbeitsplätzen sowie für Ess- und Aufenthaltsräume ist die Mindestanforderung an die Raumakustik zu erfüllen. Dabei muss die Bedingung einer der drei folgenden Richtwertvarianten erfüllt sein:

- Schallabsorptionskoeffizient αs > 0,25
- Nachhallzeit T in Funktion des Raumvolumens nach Tabelle 322-3 der SECO-Wegleitung zu Art. 22 ArGV3, SR 822.113
- Schalldruckpegelabnahme pro Distanzverdoppelung DL 2 ≥ 4 dB Weitere Infos siehe [suva.ch/laerm](https://www.suva.ch/laerm).", "fr": "", "it": ""}

{"de": "**Bitte beachten:** Die Tiefbauten sind in zwei Kategorien unterteilt. Analog wie bei den Hochbauten können beliebig viele Tiefbauanlagen erfasst werden. 

- **Tiefbauten-Siedlung:** Diese Art von Tiefbauten wie z.B. Parkplätze, Veloabstellplätze oder Angaben zu den Anschlüssen wie Wasser, Abwasser usw. werden in der Regel im Zusammenhang mit einem Hochbauprojekt erstellt. 
- **Tiefbauten-Landschaft:** Diese Art von Tiefbauten wie Terrainveränderungen, Erschliessungen usw. werden in der Regel einzel als Bauprojekt eingereicht und folglich auch einzeln erfasst.", "fr": "", "it": ""}

fields.info_text:
{"de": "#### INFO
Bei künstlicher Lüftung oder Klimatisierung ist ein Lüftungskonzept beizulegen (Art, Anzahl Luftwechsel und weitere technische Angaben, CO₂ Werte beachten).

Bitte geben Sie im dafür vorgegebenen Textfeld an, welche Räumlichkeiten künstlich belüftet bzw. klimatisiert werden.", "fr": null, "it": null}

